import React from "react";
import { Link } from "react-router-dom";

const Header = () => {
    return (
        <header className="header">
            <div className="header__logo">
                <Link to="/">
                    <img src="../assets/logo.webp" alt="Logo" />
                </Link>
            </div>

        </header>
    )
};

export default Header;
